import React, { useEffect } from "react";
import axios from "axios";
const getRandomPhotos = () => {
  return axios
    .get(`https://picsum.photos/v2/list`)
    .then(function (res) {
      // handle success
      console.log(res);
      return res.data;
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    });
};
const Photos = () => {
  useEffect(() => {});
  return <div></div>;
};

export default Photos;
